css:
@-moz-document domain("octobox.io") {
body {
    background-color: #282828;
}
.navbar {
    background-color: #282828;
}
.flex-sidebar {
    filter: contrast(110%) brightness(90%) invert(1) hue-rotate(180deg);
    background-color: #ddd;
}
.flex-main {
    background-color: transparent;
}
.flex-main > div:nth-child(1) {
    filter: brightness(87%) invert(1) brightness(90%) hue-rotate(180deg);
}
}
